import * as types from './../constants/ActionTypes'

var initalState = [            {
    id: this.generateID(),
    name: 'Học lạp trình1',
    status: true
},

{
    id: this.generateID(),
    name: 'Học lạp trình2',
    status: false
},]
;

export var tasks = ( state = initalState, action) =>{
    switch(action.type){
        case types.LIST_ALL:
            return state;
            default : return state;
    }
}
